oxy_webhelp_navlinks = {"sla_domain_administration-d23139e3635":{"topics":[{"title":"Creating a custom SLA Domain","shortdesc":"<p class=\"shortdesc\">Create a custom SLA Domain to streamline and customize workload protection and         management policies.<\/p>","href":"saas\/rsc_creating_custom_sla_domain.html","attributes":{"data-id":"rsc_creating_custom_sla_domain"},"menu":{"hasChildren":false},"tocID":"rsc_creating_custom_sla_domain-d23139e3648","next":"rsc_creating_custom_sla_domain-d23139e3648"},{"title":"Creating SLA Domains for many-to-one replication","shortdesc":"<p class=\"shortdesc\">Create an SLA Domain for many-to-one replication, the traditional replication mode         supported by <span class=\"ph\">RSC<\/span> SLA Domains. This method consolidates data protection from         multiple source clusters onto a single target cluster, ensuring centralized recovery and         protection.<\/p>","href":"saas\/rsc_creating_sla_domains_manytoone_rep.html","attributes":{"data-id":"rsc_creating_sla_domains_manytoone_rep"},"menu":{"hasChildren":false},"tocID":"rsc_creating_sla_domains_manytoone_rep-d23139e3681","topics":[]},{"title":"Creating SLA Domains for one-to-one replication","shortdesc":"<p class=\"shortdesc\">Create an SLA Domain for one-to-one replication when there are more than two         replication targets and the source and replication clusters are in a dedicated replication         configuration. With one-to-one replication, you can configure multiple replication pairs,         but a source cluster can replicate to a maximum of two target clusters.<\/p>","href":"saas\/rsc_creating_sla_domains_onetoone_rep.html","attributes":{"data-id":"rsc_creating_sla_domains_onetoone_rep"},"menu":{"hasChildren":false},"tocID":"rsc_creating_sla_domains_onetoone_rep-d23139e3695","topics":[]},{"title":"Archival policy","shortdesc":"<p class=\"shortdesc\">A Rubrik cluster archives data according to an archival policy that instructs the         Rubrik cluster to copy protected data to archival locations.<\/p>","href":"saas\/archival_policy.html","attributes":{"data-id":"archival_policy"},"menu":{"hasChildren":false},"tocID":"archival_policy-d23139e3706","next":"archival_policy-d23139e3706"},{"title":"Replication settings for specific workloads","shortdesc":"<p class=\"shortdesc\">When replication is enabled for specific workloads when creating or editing an SLA         Domain, it requires specific settings to be configured.<\/p>","href":"saas\/replication_settings_for_specific_workloads.html","attributes":{"data-id":"replication_settings_for_specific_workloads"},"menu":{"hasChildren":false},"tocID":"replication_settings_for_specific_workloads-d23139e3787","topics":[]},{"title":"Replication target changes","shortdesc":"<p class=\"shortdesc\">Editing the replication targets in an SLA Domain does not impact existing         snapshots.<\/p>","href":"cdm\/replication_target_changes.html","attributes":{"data-id":"replication_target_changes"},"menu":{"hasChildren":false},"tocID":"replication_target_changes-d23139e3798","topics":[]},{"title":"Replication configuration types in SLA Domain","shortdesc":"<p class=\"shortdesc\">You can configure replication types, such as many-to-one and one-to-one, and         configure replication between multiple source and target clusters using a single SLA Domain         to maintain consistent backup and disaster recovery.<\/p>","href":"saas\/replication_config_types_sla_domain.html","attributes":{"data-id":"replication_config_types_sla_domain"},"menu":{"hasChildren":false},"tocID":"replication_config_types_sla_domain-d23139e3809","next":"replication_config_types_sla_domain-d23139e3809"},{"title":"Continuous Data Protection-only SLA Domains for Amazon RDS","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">RSC<\/span> workloads, such as Amazon RDS, support both continuous data         backup and scheduled backups. You can enable them as needed. With Continuous Data         Protection-only SLA Domains, you can exclude snapshot schedules for supported workloads by         turning off the frequency and retention when creating or editing the Continuous Data         Protection-only SLA Domains.<\/p>","href":"saas\/sla_domains_without_snapshot_schedules.html","attributes":{"data-id":"sla_domains_without_snapshot_schedules"},"menu":{"hasChildren":false},"tocID":"sla_domains_without_snapshot_schedules-d23139e3864","next":"sla_domains_without_snapshot_schedules-d23139e3864"},{"title":"Retention-locked SLA Domains","shortdesc":"<p class=\"shortdesc\">The retention lock feature on <span class=\"ph\">RSC<\/span> SLA Domains ensures the security         and integrity of your data for a specified duration by preventing the premature deletion of         snapshots for various workloads.<\/p>","href":"saas\/retention_locked_sla_domain.html","attributes":{"data-id":"retention_locked_sla_domain"},"menu":{"hasChildren":false},"tocID":"retention_locked_sla_domain-d23139e3921","next":"retention_locked_sla_domain-d23139e3921"},{"title":"Cloning a custom SLA Domain","shortdesc":"<p class=\"shortdesc\">Create a clone of an existing SLA Domain.<\/p>","href":"saas\/cloning_custom_sla_domain.html","attributes":{"data-id":"cloning_custom_global_sla_domain"},"menu":{"hasChildren":false},"tocID":"cloning_custom_global_sla_domain-d23139e4029","topics":[]},{"title":"Edit an SLA Domain","shortdesc":"<p class=\"shortdesc\">Make changes to an existing custom SLA Domain.<\/p>","href":"saas\/edit_sla_domain.html","attributes":{"data-id":"edit_sla_domain"},"menu":{"hasChildren":false},"tocID":"edit_sla_domain-d23139e4041","topics":[]},{"title":"Viewing SLA Domain details","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">RSC<\/span> provides a specific page for each SLA Domain.<\/p>","href":"saas\/viewing_sla_domain_details.html","attributes":{"data-id":"viewing_sla_domain_details"},"menu":{"hasChildren":false},"tocID":"viewing_sla_domain_details-d23139e4052","topics":[]},{"title":"Deleting an SLA Domain","shortdesc":"<p class=\"shortdesc\">Delete an SLA Domain to remove it from <span class=\"ph\">RSC<\/span>.<\/p>","href":"saas\/deleting_an_sla_domain.html","attributes":{"data-id":"deleting_an_sla_domain"},"menu":{"hasChildren":false},"tocID":"deleting_an_sla_domain-d23139e4065","topics":[]},{"title":"SLA Domain protection pause and resume","shortdesc":"<p class=\"shortdesc\">SLA Domain protection pause and resume allows you to temporarily pause and resume the         protection activity within an SLA Domain.<\/p>","href":"saas\/pause_and_resume_for_sla_domains.html","attributes":{"data-id":"pause_and_resume_for_sla_domains"},"menu":{"hasChildren":false},"tocID":"pause_and_resume_for_sla_domains-d23139e4079","next":"pause_and_resume_for_sla_domains-d23139e4079"}]}};